import React, { useEffect, useState } from 'react'
import { sumid } from '../components/Refugeecard'

function Refugeeq() {

  const id = sumid();
  const url = "http://localhost:3001";
  const [data, setdata] = useState ();

  Axios.post (`${url}/refq`, {
    id: id,
}
)
.then((res)=>{
   setdata(res.data) 
})
.catch (err=>{
 console.log(err);
})




  return (
    <div>
       <h1>{id}</h1>
       <h1>Test</h1>
    </div>
  )
}

export default Refugeeq
